import './Header.css';
import React from "react";
import Logo from "./Logo";

function Header() {

    return (
        <React.StrictMode>
            <header className="header-wrapper">
                <div className="header-logo-container">
                    <Logo />
                </div>
                <div className="header-nav-container">

                </div>
            </header>
        </React.StrictMode>
    );
}

export default Header;
